import React from "react";
import "./styles/style.css";

function Footer() {
  return (
    <footer>
      <ul>
        <li>CONTACT</li>
        <li>SOCIAL</li>
        <li>SHIPPING</li>
        <li>HELP</li>
        <li>TERMS OF USE</li>
      </ul>
    </footer>
  );
}

export default Footer;
